    [],nt"revision_timestamp": "2016-07-27T22:21:20.197731",nt"name": "frog-malformations-at-the-san-luis-national-wildlife-refuge-complex-2000-2001",nt"isopen":
    false,nt"url": null,nt"notes": "In 2000 a nationwide survey of amphibian
    malformations was initiated. Because of its history of contamination with agricultural
    drainwater, the San Luis NWR Complex was selected in 2000 to be included in this
    survey. Overall, the incidence of malformations on the San Luis National Wildlife
    Refuge Complex was 2 of 3 51,or about0.6%. However, at the specific locations where
    the malformations were found, the incidences were1 of 10 and 1 of 60,or 1 0% and
    1. 7% at Cottonwood Canal and Swan Lake respectively. These site-specific incidences
    are within the range of malformation rates regarded as indicative of a problem (U.
    S. Fish and Wildlife Service Region 1 Environmental Contaminants FY2000Amphibian
    Initiative Work Plan). Further survey efforts should be targeted at least at the
    sites where the malformations were found in order to confirm the results reported
    here. and to improve the estimates of malformation rates as well as to investigate
    possible causes of the malformations. Both locations where the malformations were
    found are close to the San Luis Drain and now-filled Kesterson Reservoir that are
    highly contaminated with subsurface agricultural drain water.",nt"license_title":
